sources.custom.scss:
@import "./grid";
@import "./content_area.scss";

$purpleLight: rgb(172, 9, 172);
$purpleDark: rgb(49, 3, 49);
$grayDark: grey;

* {
    box-sizing: border-box;
}

body{
    background-color: #8EC5FC;
    background-image: linear-gradient(62deg, #8EC5FC 0%, #E0C3FC 100%);

}

#side-menu{
    background: $purpleLight;
    width: 280px;
    position: absolute;
    top:0;
    bottom:0;
    height: 100vh;

    nav{
        padding-top: 100px;
        a{
            display: block;
            color: white;
            text-decoration: none;
            padding: 15px 30px;

            .fa {
                color: white;
                font-size: size 1.4rem;
                margin-right: 0.8rem;
                width:30px;
                position:relative;
            }

            &:hover{
                transition: all .3s ease-in-out;
                background:$purpleDark;
                border-left: 5px solid greenyellow;
                padding: 15px 30px 15px 25px;

                .fa {
                    color: greenyellow;
                }
            }
            &.active{
                background:$purpleDark;
                border-left: 5px solid greenyellow;
                padding: 15px 30px 15px 25px;

                .fa {
                    color: greenyellow;
                }
            }

        }
    }
}

#header{
    margin-left: 280px;
    padding: 20px;
    background-color: white;

    .search-area{
        display:inline-block;
        width: 50%;

        .fa{
            color: $grayDark;
            margin-right: 10px;
        }
        input[type="text"]{
            background: transparent;
            border: none;
            font-size: 1.3rem;
            color: greenyellow;
            padding: 10px;
            font-weight: 100;
            width: 80%;
            height: 30px;
            transition: all 0.5s ease-in-out;

            &:hover{
                background: lightgray;
            }
        }

        textarea:focus, input:focus{
           outline:none; 
        }

    }

    .user-area{
        float: right;

        a{
            display: inline-block;
            padding-right: 10px;
            text-decoration: none;
            vertical-align: top;
            height: 30px;

            &.add{
                font-size:16px;
                font-weight: 300;
                padding-top: 5px;
            }

            &.notification{
                position: relative;
                padding-right: 20px;
                padding-top: 6px;
                font-size:20px;

                .circle{
                    display:inline-block;
                    background: red;
                    width: 16px;
                    height:16px;
                    border-radius: 50%;
                    font-size: 11px;
                    color: white;
                    text-align: center;
                    position: absolute;
                    top: -3px;
                    left: 10px;
                }
            }

            .user-img{
                background: url("https://images.unsplash.com/photo-1519699047748-de8e457a634e?ixlib=rb-1.2.1&q=80&fm=jpg&crop=faces&fit=crop&h=200&w=200&ixid=eyJhcHBfaWQiOjE3Nzg0fQ") no-repeat center center; 
                -webkit-background-size: cover;
                -moz-background-size: cover;
                -o-background-size: cover;
                background-size: cover;
                border-radius: 50%;
                width: 30px;
                height:30px;
                display: inline-block;
                margin-right: 10px;
            }

            .fa-caret-down{
                position: relative;
                top: -8px;
                font-size: 16px;
            }

        }
    }
}
